INSERT INTO `items` (`id`, `name`, `price`, `state`, `image`, `description`) VALUES
(1, 'Apple - iPhone 5c 16GB Cell Phone - Blue', 649.99, 5, , 'A6 chip. 8MP camera. Capacitive touch-screen display. Ultrafast LTE wireless. iPhone 5c has the things that made iPhone 5 an amazing phone — and more, including iOS 7. All in a completely new design that feels great in your hand.');
INSERT INTO `items` (`id`, `name`, `price`, `state`, `image`, `description`) VALUES
(2, 'Apple - iPhone 6 Plus Smartphone 4G - Space Gray', 999.99, 5, , 'iPhone 6 isn''t simply bigger - it''s better in every way. Larger, yet dramatically thinner. More powerful, but remarkably power efficient. With a smooth metal surface that seamlessly meets the new Retina HD display. It''s one continuous form where hardware and software function in perfect unison, creating a new generation of iPhone that''s better by any measure.');
INSERT INTO `items` (`id`, `name`, `price`, `state`, `image`, `description`) VALUES
