INSERT INTO `items` (`id`, `name`, `price`, `state`, `image`, `description`) VALUES
(6, 'Huawei - Ascend Mate 7 4G with 16GB Memory - White', 529.99, 5, , 'Connect with friends and family with this Huawei Ascend Mate 7 MT7-L09 WHITE cell phone, which features a large 16GB capacity for ample storage and a 6" touch screen for simple navigation. Wi-Fi and 4G LTE speed offer fast Web connection on the go.');
INSERT INTO `items` (`id`, `name`, `price`, `state`, `image`, `description`) VALUES
